import React from 'react';
import logo from './logo.png'
import './NavigationBar.css';

export default class NavigationBar extends React.Component {
    constructor(props) {
        super(props);
        
        this.trees = {
            "BST" : "Binary Search Tree",
            "AVL" : "AVL Tree",
            "RBT" : "Red-Black Tree",
            "BHP" : "Binary Heap"
        };

        this.state = {
            active: "BST"
        };
    }

    openDropdown(selector = "BST") {
        alert(selector);
    }

    render() {
        return (
            <>
                <div id="navbar-wrapper">
                    <span className="navbar-logo">
                        <img src={logo} alt="logo" />
                    </span>
                    
                    <span id="tree-dropdown" class="dropdown">
                        <button class="dropdown-toggle" onclick={openDropdown(this.state.active)}>{this.trees[ this.state.active ]}</button>
                        <ul class="dropdown-menu">
                        </ul>
                    </span>
                </div>
            </>
        );
    }
}
